import React, { useState } from 'react';

import Header from './Header';

function App() {

  const [counter, setCounter] = useState(0);

  function increment() {
    setCounter(counter++);
  }

  return (
    <div>
      <Header>
        Contador: {counter}
      </Header>
      <button onClick={increment}>Adicionar</button>
    </div>

  );
}

export default App;
